exports.step = function(input) {
  return {
    q:
      `
  SELECT distinct c.name
  FROM subscription s 
  INNER JOIN classification c on c.id = s.class
  WHERE (s.customer = ${input.customerId} OR s.custrecord_subs_end_user = ${input.customerId})
  AND s.billingsubscriptionstatus in ('DRAFT','ACTIVE')` 
  };
};

exports.step = function (input) {
  const class_name = input.class.split(':').pop().trim();
  const product_name = class_name.replace(' Product','');
  return product_name;
};

exports.step = function(input) {
  const sfProducts = input.sfProducts.map(i => i.Product__c);
  for (const cls of input.nsClasses) {
    const productName = cls.name.replace(' Product','');
    if (sfProducts.includes(productName)) {
      return true;
    }
  }
  return false;
};
